import { observable, action, toJS } from 'mobx'

export default class BusinessParametersSetupStore {
  @observable pendingApprovals = []

  @action
  selectProductToDelete (productSelected){
    productSelected.ticket = '00000'+this.pendingApprovals.length++
    // let addTicket = {...productSelected,'ticket':'000000'+this.pendingApprovals.length++}
    this.pendingApprovals.push(productSelected)
    console.log(toJS(this.pendingApprovals))
  }
}
